using Api.Services;
using Infraestrutura;
using Infraestrutura.Models;
using Microsoft.AspNetCore.Mvc;
using PosgramAPI.Data;
using PosgramAPI.Models.Dto;

namespace PosgramAPI.Controllers
{
    [Route("api/[Controller]")]
    [ApiController]
    public class PostagemController : ControllerBase
    {
        private readonly ApplicationDbContext _context;
        private readonly IConfiguration _configuration;
        private readonly BlobServices _blobServices;

        public PostagemController(ApplicationDbContext context, IConfiguration configuration)
        {
            _context = context;
            _configuration = configuration;
            _blobServices = new BlobServices(_configuration);
        }

        [HttpGet]
        public ActionResult<IEnumerable<PostagemDto>> GetPostagens()
        {
            var get = _context;            
            return Ok(PostagemStore.listaPostagem);
        }

        [HttpGet("{id:int}", Name = "GetPostagem")]
        [ProducesResponseType(StatusCodes.Status200OK)]
        [ProducesResponseType(StatusCodes.Status404NotFound)]
        [ProducesResponseType(StatusCodes.Status400BadRequest)]
        public async Task<ActionResult<PostagemDto>> GetPostagem(int id)
        {
            await _blobServices.GetBlob("");

            var get = _context;
            if (id == 0)
            {
                return BadRequest();
            }
            var postagem = PostagemStore.listaPostagem.FirstOrDefault(u => u.Id == id);

            if (postagem == null)
            {
                return NotFound();
            }
            return Ok(postagem);
        }

        [HttpPost]
        [ProducesResponseType(StatusCodes.Status201Created)]
        [ProducesResponseType(StatusCodes.Status400BadRequest)]
        public async Task CreatePostagemAsync([FromBody] PostagemDto postagemDto)
        {
            var imagem = "";
            
            postagemDto.Imagem = imagem;
            var postagem = new Postagem(postagemDto.Autor, postagemDto.Legenda, postagemDto.Imagem, "frances.png", postagemDto.DataHoraPostagem!.Value);
            await _blobServices.CreateBlob(postagem);
        }

        [HttpDelete("{id:int}")]
        [ProducesResponseType(StatusCodes.Status204NoContent)]
        [ProducesResponseType(StatusCodes.Status404NotFound)]
        [ProducesResponseType(StatusCodes.Status400BadRequest)]
        public async Task<ActionResult> DeletePostagem(int id)
        {
            await _blobServices.DeleteBlob("");

            if (id == 0)
            {
                return BadRequest();
            }
            var postagem = PostagemStore.listaPostagem.FirstOrDefault(u => u.Id == id);

            if (postagem == null)
            {
                return NotFound();
            }

            PostagemStore.listaPostagem.Remove(postagem);

            return NoContent();
        }

    }
}
